import React, { Component } from "react";

class Clicker extends Component {
  increment = () => {
    this.props.store.count++;
  };
  decrement = () => {
    this.props.store.count--;
  };
  render() {
    return (
      <div>
        <div>
          <span>{this.props.store.count}</span>
        </div>
        <div>
          <button>+</button>
          <button>Reset</button>
          <button>-</button>
        </div>
      </div>
    );
  }
}

export default Clicker;
